				define("builtins/storage", [], 	function () {
					 var OBJECT_PREFIX = "object stored: ";
					 var FUNCTION_PREFIX = "function stored: ";
					 var INTEGER_PREFIX = "integer stored: ";
					 var FLOAT_PREFIX = "float stored: ";
					 return {
						  get: function (key) {
								var storage = {};
								var value = undefined;
								if (typeof window === 'undefined') {
									 var fileSystem = require("fs");
									 if (fileSystem.existsSync("./storage.json")) {
										  storage = JSON.parse(fileSystem.readFileSync("./storage.json").toString())
									 }
									 value = storage[key];
								} else {
									 value = localStorage.getItem(key);
								}
								if (value === undefined || value === null) {
									 value =  undefined;
								} else if (value.startsWith(OBJECT_PREFIX)) {
									 value = JSON.parse(value.substring(OBJECT_PREFIX.length, value.length));
								} else if (value.startsWith(INTEGER_PREFIX)) {
									 value = parseInt(value.substring(INTEGER_PREFIX.length, value.length));
								} else if (value.startsWith(FLOAT_PREFIX)) {
									 value = parseFloat(value.substring(FLOAT_PREFIX.length, value.length));
								}
								return new Promise(function (resolve) {
									 resolve(value);
								})
						  },
						  set: function (key, value) {
								if (typeof window === 'undefined') {
									 var fileSystem = require("fs");
									 var storage = {};
									 if (fileSystem.existsSync("./storage.json")) {
										  storage = JSON.parse(fileSystem.readFileSync("./storage.json").toString())
									 }
									 storage[key] = value;
									 if (typeof value === 'string') {
										  storage[key] = value;
									 }
									 if (typeof value === 'object') {
										  storage[key] = OBJECT_PREFIX + JSON.stringify(value);
									 } 
									 if (typeof value === 'function') {
										  storage[key] = FUNCTION_PREFIX + value.toString();
									 } 
									 if (typeof value === 'number') {
										  if (value.toString().indexOf(".") !== -1) {
												// Float
												localStorage.setItem(key, FLOAT_PREFIX + value.toString());
										  } else {
												// Integer
												localStorage.setItem(key, INTEGER_PREFIX + value.toString());
										  }
										  
									 } 
									 var storageFile = fileSystem.openSync("./storage.json", "w");
									 
									 fileSystem.writeSync(storageFile, JSON.stringify(storage));
									 fileSystem.close(storageFile);
								} else {
									 if (typeof value === 'string') {
										  localStorage.setItem(key, value);
									 }
									 if (typeof value === 'object') {
										  localStorage.setItem(key, OBJECT_PREFIX + JSON.stringify(value));
									 } 
									 if (typeof value === 'function') {
										  localStorage.setItem(key, FUNCTION_PREFIX + value.toString());
									 } 
									 if (typeof value === 'number') {
										  if (value.toString().indexOf(".") !== -1) {
												// Float
												localStorage.setItem(key, FLOAT_PREFIX + value.toString());
										  } else {
												// Integer
												localStorage.setItem(key, INTEGER_PREFIX + value.toString());
										  }
									 }
								}
								return new Promise(function (resolve) {
									 resolve();
								})
						  }
					 }
				});
			
				define("builtins/loader", [], 	function () {
					var onload = function (listener, listenerType = 'load') {
						if (typeof window === 'undefined') {
							listener();
						} else {
							if (document.readyState === 'complete') {
								listener();
							} else {
								window.addEventListener(listenerType, listener);
							}
						}
					}
					return {
						onload: onload
					};
				});

			img {
			    max-width: 100%;
			}
			
			img[src=""] {
			    display: none;
			}
			
			textarea {
			    max-width: 100%;
			    min-width: 100%;
			    min-height: 120px;
			    box-sizing: border-box;
			    border: none;
			    border-radius: 5px;
			    padding: 10px 10px 10px 10px;
			    margin: 10px 10px 10px 0px;
			}
			
			.card-list {
			    display: flex;
			    flex-wrap: wrap;
			    justify-content: space-evenly;
			    max-width: 1200px;
			}
			
			.card .inner {
			    width: 100%;
			    padding: 20px;
			    background-color: #eee;
			    margin: 10px 0px;
			    border-radius: 5px;
			    box-sizing: border-box;
			}
			
			.card .outer {
			    padding-right: 15px;
			}
			
			.card img, .card audio {
			    margin-bottom: 15px;
			    max-height: 163px;
			}
			
			.card p {
			    padding: 0;
			    margin: 0;
			    min-height: 2.5rem;
			}
			
			.card a + h1 + p,
			.card a + h1 + p {
			    min-height: 0;
			}
			
			.card h1 {
			    margin: 0;
			}
			
			.card[data-col="12"] {
			    width: 100%;
			}
			
			.card[data-col="6"] {
			    width: 50%;
			}
			
			.user-card {
			    position: fixed;
			    top: 0;
			    right: 0;
			    padding: 20px;
			    background-color: #efefef;
			    border-radius: 0px 0px 0px 5px;
			}
			
			.user-card img {
			    border-radius: 50%;
			    width: 50px;
			    vertical-align: middle;
			    margin-right: 10px;
			}
			
			.user-card span {
			    vertical-align: middle;
			}
			
			span.under {
			    display: block;
			    margin-top: -20px;
			}
			
			@media (prefers-color-scheme: dark) {
			    body {
			        background-color: #1d1d1d;
			        color: white;
			    }
			
			    a {
			        color: #99f;
			    }
			
			    .card .inner {
			        background-color: #333;
			    }
			
			    textarea {
			        background-color: #292929;
			        color: white;
			    }
			
			    .user-card {
			        background-color: #333;
			    }
			}
			
			@media (max-width: 1400px) {
			    .user-card {
			        background-color: #c9c9c9;
			    }
			    @media (prefers-color-scheme: dark) {
			        .user-card {
			            background-color: #212121;
			        }
			    }
			}
			
			@media (max-width: 700px) {
			    .card[data-col="6"] {
			        width: 100%;
			    }
			
			    .card .outer {
			        padding-right: 0px;
			    }
			
			    .user-card {
			        bottom: 0;
			        left: 0;
			        top: initial;
			        width: 100%;
			        border-radius: 0px;
			
			    }
			}
			
			a {
			    text-decoration: none;
			}
			
			a:hover {
			    text-decoration: underline;
			}
			
			
		</style>
    </head>
